import React from 'react';

const CarouselItem = () => {
  return (
    <div>
      <iframe
        title="YouTube Video"
        width="250"
        height="200"
        src="https://www.youtube.com/embed/b7idX3iMnqI"
        frameBorder="0"
        allowFullScreen
      ></iframe>
    </div>
  );
};

export default CarouselItem;
